To manipulate the bytes of an input file, we use the ioutil package. We'll create two functions, getBytes and createNew that we will use to read the input file into a slice of bytes and then create a new file after we've mutated them. We can also include a small function, check that we use to check error values. These helper functions are done simply: // Check and panic on error
func check(e error) { if e != nil { panic(e) }
} // Retrieve bytes from `filename`
func getBytes(filename string) []byte { f, err := ioutil.ReadFile(filename) check(err) return f
} // Create new file with `data`
func createNew(data []byte) { err := ioutil.WriteFile("mutated.jpg", data, 0644) check(err)
}

