###The Bit Flip An easy way to change input data is a simple bit flip. To implement this, I decided I would randomly select a percentage of the bytes in the file, and of that subset I'd change a byte randomly. This is slightly different than changing a singular bit randomly throughout the file, however I felt it achieved generally the same effect. To begin we'll need to select bytes at random, keeping track of their indexes in the input byte slice. We subtract 4 bytes off of the the file length to account for the FF D8 FF DB jpg file header. var byteIndexes []int
numBytes := int(float64(len(data)-4) * .01)
for len(byteIndexes) < numBytes { // For random ints in range = rand.Intn(Max - Min) + Min byteIndexes = append(byteIndexes, rand.Intn((len(data)-4)-4)+4)
}
fmt.Println("Indexes chosen: ", byteIndexes) Knowing these indexes, we'll then loop through the data and change the values of the target bytes, and return the mutated byte slice. // Randomly change the bytes at the location of the chosen indexes for _, index := range byteIndexes { oldbytes := data[index] newbytes := byte(rand.Intn(0xFF)) data[index] = newbytes fmt.Printf("Changed %x to %x\n", oldbytes, newbytes) } return data

